import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Product from './components/Product';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

const Womencategories = [
  {
    name: "Tshirt",
    image: "https://sp.yimg.com/ib/th?id=OPAC.t0Vf3%2f1yQBB8Ng474C474&o=5&pid=21.1&w=174&h=174",
    link: "Tshirt",
  },
  {
    name: "Shirt",
    image: "https://static.zara.net/assets/public/a225/c064/fdbd48cc859b/55b9055f5a22/02197340250-p/02197340250-p.jpg?ts=1765984818552&w=1440",
    link: "Shirt",
  },
  {
    name: "Pant",
    image: "https://www.everlane.com/collections/womens-jeans?page=1&fq=Fit%3ARelaxed%2FBaggy",
    link: "Pant",
  },
  {
    name: "Sweater",
    image: "https://media.everlane.com/image/upload/c_scale,dpr_1.5,f_auto,q_auto,w_auto/v1/i/e8869f36_f2f0.jpg",
    link: "Sweater",
  },
];

function App() {
  return (
    <Router>
      <Navbar />
      {/* Pass categories prop here */}
      <Product categories={Womencategories} />

      <Routes>
        <Route exact path="/signup" element={<Signup />} />
        <Route exact path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
